var Drupal = Drupal || {};

(function($, Drupal) {
  Drupal.behaviors.otcorg_summer_theme = {
    attach: function(context, settings) {
      $('body', context).once('jsLoaded', function () {
        var browser = {},
        isProject = $('body').hasClass('section-projects'),
        el = $(window).scrollTop() > 0 ? window : ($('body').scrollTop() > 0 ? $('body') : $('body').scrollTop() > 0 ? $('body') : false),
        $feedback = $('.region-feedback'),
        $feedbackContent = $('.region-feedback .content'),
        $feedbackHeight = 0;

        $.getScript('//connect.facebook.net/en_US/sdk.js', function(){
          FB.init({
            appId: '398906126966762',
            version: 'v2.7' // or v2.1, v2.2, v2.3, ...
          });
        });

        $.ajax({
      		url: "https://geoip-db.com/jsonp",
      		jsonpCallback: "callback",
      		dataType: "jsonp",
      		success: function( location ) {
      			if (location.country_code == 'CN') {
              $('#footer-menu li.last').removeClass('last');
              $('#footer-menu ul').append('<li class="last"><a href="http://www.miitbeian.gov.cn/state/outPortal/loginPortal.action;jsessionid=7p8LNcbLvTfqFKFnD9dVJPYB3kpXcznY7M2QYMtnpHvJ4pnLnhYQ!12390567" title="沪ICP备14017240号" target="_blank">沪ICP备14017240号</a></li>');
            }
      		}
      	});

        var theme = $('body').hasClass('intel_gfx');

        if ($('.paragraphs-item-slider').length > 0 && !theme) {
          $('.field-name-field-slider-image').before('<div class="project-slider-img-overlay" />');

          $('#main-content').addClass('no-margin');
          $('main').addClass('with-slider');

          $('.project-slider-wrapper').slick({
            'slidesToShow': 1,
            'slidesToScroll': 1,
            'dots': true,
            'mobileFirst': true,
            'autoplay': true,
            'autoplaySpeed': 9000,
            'fade': true,
            'pauseOnHover': false,
            'adaptiveHeight': true
          });
        }

        /*
        * Identifies user browser and version
        */
        this.setBrowser = function(){
          var navigatorUserAgent = navigator.userAgent,
              isIE11 = !!navigator.userAgent.match(/Trident.*rv[:]*11\./);

            if(navigatorUserAgent.indexOf("Chrome") != -1){
              browser.Chrome = true;
              $('html').addClass('browser-Chrome');

              if(navigatorUserAgent.indexOf("Chrome/3.") != -1){
                browser.oldBrowser = true;
              }

            } else {
              if(navigatorUserAgent.indexOf("Safari") != -1){
                browser.Safari = true;
                $('html').addClass('browser-Safari');

                if(navigatorUserAgent.indexOf("Version/5") != -1 ||
                   navigatorUserAgent.indexOf("Version/4") != -1 ||
                   navigatorUserAgent.indexOf("Version/3") != -1){
                  browser.SafariOld = true;
                  browser.oldBrowser = true;
                }
              }
            }

            if(navigatorUserAgent.indexOf("Firefox") != -1){
              browser.FF = true;
              $('html').addClass('browser-FF');
            }

            if(navigatorUserAgent.indexOf("MSIE") != -1){
              browser.IE = true;
              $('html').addClass('browser-IE');

              if(navigatorUserAgent.indexOf("MSIE 6") != -1){
                browser.IE6=true;
                browser.oldBrowser = true;
              }

              if(navigatorUserAgent.indexOf("MSIE 7") != -1){
                browser.IE7 = true;
                browser.oldBrowser = true;
              }

              if(navigatorUserAgent.indexOf("MSIE 8") != -1){
                browser.IE8 = true;
                browser.oldBrowser = true;
                $('html').addClass('browser-IE8');
              }

              if(navigatorUserAgent.indexOf("MSIE 9") != -1){
                browser.IE9 = true;
                $('html').addClass('browser-IE9');
              }

              if(navigatorUserAgent.indexOf("MSIE 10") != -1){
                browser.IE10 = true;
                $('html').addClass('browser-IE10');
              }
            }
            else
            {
              if(navigatorUserAgent.indexOf("iPad")!=-1){
                browser.mobile = true;
                browser.iOS = true;
                browser.iPad = true;
              }
              else
              {
                if(navigatorUserAgent.indexOf("iPod")!=-1){
                  browser.mobile = true;
                  browser.iOS = true;
                  browser.iPod = true;
                }
                else
                {
                  if(navigatorUserAgent.indexOf("iPhone")!=-1){
                    browser.mobile = true;
                    browser.iOS = true;
                    browser.iPhone = true;
                  }
                  else
                  {
                    if(navigatorUserAgent.indexOf("Android")!=-1){
                      browser.mobile = true;
                      browser.Android = true;
                    }
                    else
                    {
                      if(navigatorUserAgent.indexOf("BlackBerry")!=-1){
                        browser.mobile = true;
                        browser.BlackBerry = true;
                      }
                      else
                      {
                        if(isIE11){
                          browser.IE11 = true;
                          browser.IE = true;
                          $('html').addClass('browser-IE');
                          $('html').addClass('browser-IE11');
                        }
                      }
                    }
                  }
                }
              }
            }
          };

          /*
           * Moves Header Subheader to proper position
           * and adds hover actions
           */
          this.fixHeaderSubmenu = function() {
            var submenus = $('#navbar nav .submenu-container').detach(),
                subheader_structure = '<div id="submenus"><div id="primary-submenus"><div class="submenu-background"><div class="container"></div></div></div><div id="secondary-submenus"><div class="submenu-background"><div class="container"></div></div></div></div>';

            $('#site-header').after(subheader_structure);
            submenus.appendTo('#primary-submenus .container');

            submenus = $('#navbar #secondary-menu .submenu-container').detach();
            submenus.appendTo('#secondary-submenus .container');

            $('#navbar li').hover(function(){
              if (!$(this).attr('data-submenu')) {
                hideHeaderSubmenu();
              }
            });

            $('[data-submenu]').hover(function(){
              var submenu = $(this).data('submenu');
              $('header .hover').removeClass('hover');
              $('header .submenu-open').removeClass('submenu-open');
              $(this).find('a').addClass('hover');
              $(this).addClass('hover');
              $('#' + submenu).addClass('submenu-open');
              $('#submenus').stop(true, true).fadeIn();
            });
          }

          /*
           * Hides header submenu
           */
          hideHeaderSubmenu = function() {
            $('#submenus').removeClass('submenu-open');
            $('#submenus').stop(true, true).fadeOut();
            $('header .hover').removeClass('hover');
          };

          /*
           * Adds fixed position to secondary nav if scroll is > 230
           * @param object el
           *        element that has window scroll position
           */
          fixedProjectHeader = function(el) {
            if ($(el).scrollTop() > 230) {
              $('#main-content').addClass('project-og-menu-fixed');
            } else {
              $('#main-content').removeClass('project-og-menu-fixed');

              if ($(el).scrollTop() > 100) {
                $('#project-banner').addClass('img-blur');
              } else {
                $('#project-banner').removeClass('img-blur');
              }
            }
          }

          /*
           * Adds fixed position to secondary mobile nav if scroll is > 280
           * @param object el
           *        element that has window scroll position
           */
          fixedMobileProjectHeader = function(el) {
            if ($(el).scrollTop() > 280) {
              $('main').addClass('project-mobile-og-menu-fixed');
            } else {
              $('main').removeClass('project-mobile-og-menu-fixed');
            }
          }

          /*
           * Fixes menu on window resize
           */
          fixMenu = function() {
            fixedProjectHeader(this);
            fixedMobileProjectHeader(this);
          }

          checkFeedback = function() {
            if (!$feedback.hasClass('feedback-open')) {
              feedbackHeight = -$feedbackContent.outerHeight();
              $feedback.css('bottom', feedbackHeight);
            }
          }

          this.setBrowser();

          if (!browser.mobile) {
            this.fixHeaderSubmenu();

            /*
             * Hides Header submenu on body mouseover
             * if its not over header links or submenu
             */
            $('body').mouseover(function(evt){
              if(!($(evt.target).closest('header').length > 0 || $(evt.target).closest('#submenus').length > 0 || $(evt.target).attr('id') == 'submenus')) {
                hideHeaderSubmenu();
              } else if ($(evt.target).attr('id') == 'navbar' || $(evt.target).attr('id') == 'site-header') {
                hideHeaderSubmenu();
              }
            });
          }

          /*
           * Adds scroll event for projects to add fixed secondary nav
           */
          if (isProject) {
            $(window).scroll(function() {
              fixedProjectHeader(this);
              fixedMobileProjectHeader(this);
            });

            $('body, html').scroll(function() {
              fixedProjectHeader(this);
              fixedMobileProjectHeader(this);
            });
            fixedProjectHeader(this);
            fixedMobileProjectHeader(this);

            $(window).resize(fixMenu);
            $(window).resize();
          } else {
            if ($('body').hasClass('secondary-nav') && !isProject) {
              $('#main-content').addClass('project-og-menu-fixed');
            }
          }

          /*
           * Open/Close footer mobile menu
           */
          $('footer .mobile-menu').click(function(){
            $('#footer-menu > .navbar-menu').toggleClass('open');
          });

          /**
           * Slide left mobile menu
           */
          if (typeof Menu !== 'undefined') {
            var slideLeft = new Menu({
              wrapper: '#o-wrapper',
              type: 'slide-left',
              menuOpenerClass: '.c-button',
              maskId: '#c-mask'
            });

            var slideLeftBtn = document.querySelector('#c-button--slide-left');

            slideLeftBtn.addEventListener('click', function(e) {
              e.preventDefault;
              slideLeft.open();
            });
          }

          /*
           * Tracks certain elements and
           * which element the user's screen is currently centered on
           * for Table of Contents
           */
          if ($('.scrollspy').length > 0) {
            $('.scrollspy').scrollSpy();
          }

          /*
           * Fixed positioning for Table of Contents
           */
          if ($('.toc-wrapper').length > 0) {
            $('.toc-wrapper').pushpin({ top: 30, offset: 160 });
          }

          /*
           * Changes layout to Grid
           */
          $('#grid-layout').live('click', function(evt){
            if ($('main').hasClass('row-layout')){
              $('main').removeClass('row-layout');
            }
            return false;
          });

          /*
           * Changes layout to rows
           */
          $('#row-layout').live('click', function(evt){
            if (!$('main').hasClass('row-layout')){
              $('main').addClass('row-layout');
            }
            return false;
          });

          /*
           * No Results found - expands advanced search
           */
          $('.no-custom-view-results a').click(function(){
            $('#edit-advanced a').click();
          });

          /*
           * Replicates project links action on li click
           */
          $('#project-header .project-header-actions li, .project-bottom-actions li').click(function(evt){
            if ($(this).find('.fa-bookmark').length > 0){
              $(this).find('a').click();
              $(this).find('.fa-bookmark').toggleClass('fa-bookmark fa-bookmark-o');
              return false;
            } else if ($(this).hasClass('share-icon-container')) {
              if (!($(evt.target).hasClass('.share-dropdown-content') || $(evt.target).closest('.share-dropdown-content').length != 0) && $(this).hasClass('active-share')) {
                $(this).removeClass('active-share');
              } else {
                $(this).addClass('active-share');
              }
            } else if ($(this).find('a').length > 0){
              var location = $(this).find('a').attr('href'),
                target = $(this).find('a').attr('target');

              if (target == '_blank') {
                window.open(location, target);
              } else {
                window.location.href = location;
              }
            }
          });

          /*
           * Open/Collapse project floating menu
           */
          $('#block-otcorg-projects-project-content-admin').click(function(){
            $('#floating-menus > .tabs').removeClass('content-header-open');
            $('#floating-menus > .tabs').find('.primary').hide();
            $('#floating-menus > .tabs').find('.secondary').hide();
            $(this).toggleClass('content-header-open');
            $(this).find('.content').slideToggle();
          });

          $('.contribute-links').click(function(event){
            event.preventDefault();
            $(this).toggleClass('collapsed collapse');
            $(this).next().slideToggle();
          });

          /*
           * Open/Collapse floating menu for admin
           */
          $('#floating-menus > .tabs').click(function(){
            $('#block-otcorg-projects-project-content-admin').removeClass('content-header-open');
            $('#block-otcorg-projects-project-content-admin').find('.content').hide();
            $(this).toggleClass('content-header-open');
            $(this).find('.primary').slideToggle();
            $(this).find('.secondary').slideToggle();
          });

          /*
           * Close floating menus on body click
           */
          $('body').click(function(evt){
            if ($(evt.target).closest('#floating-menus').length == 0) {
              $('#block-otcorg-projects-project-content-admin').removeClass('content-header-open');
              $('#block-otcorg-projects-project-content-admin .content').hide();
              $('#floating-menus > .tabs').removeClass('content-header-open');
              $('#floating-menus > .tabs .primary').hide();
              $('#floating-menus > .tabs .secondary').hide();
            }
            if ($(evt.target).closest('.share-icon-container').length == 0) {
              $('.share-icon-container').removeClass('active-share');
            }
          });

          /*
           * Calls FB API to share
           */
          $('.node-share-item-facebook').click(function(){
            url = window.location.href;

            FB.ui({
              method: 'share',
              href: url,
              redirect_uri: url,
            }, function(response){

            });
          });

          /*
           * Calls Twitter API to tweet
           */
          $('.node-share-item-twitter').click(function(){
            url = 'https://twitter.com/intent/tweet?url=' + window.location.href;
            window.open(url, '_blank');
          });

          /*
           * Calls Reddit API to publish
           */
          $('.node-share-item-reddit').click(function(){
            //title = $('meta[property="og:title"]').attr('content');
            url = 'https://www.reddit.com/' + window.location.href;
            window.open(url, '_blank');
          });

          /**
           * Improve for search ajax in projects
           */
           if ($('body').hasClass('page-projects')) {
            $(document).ajaxSend(function( event, jqxhr, settings ) {
              var searchValue = $('#edit-keys').val();

              if (searchValue.length > 0 && searchValue.length < 4) {
                $('.ajax-progress.ajax-progress-throbber').remove();
                jqxhr.abort();
              } else {
                if (!$('.region-feedback').hasClass('feedback-open')) {
                  $('.ajax-progress.ajax-progress-throbber').remove();
                  $('.view-content').addClass('ajax-transition');
                }
              }

            }).ajaxComplete(function(event, jqxhr, settings){
              //$('select').material_select();
              //$('select').hide().material_select();
            });
          }

         /**
         * About tooltips
         */

         $('.timeline-about-hover').hover(function(){
                // Hover over code
                var title = $(this).attr('title');
                $(this).data('tipText', title).removeAttr('title');
                $('<p class="about-tooltip"></p>')
                .text(title)
                .appendTo('body')
                .fadeIn('slow');
        }, function() {
                // Hover out code
                $(this).attr('title', $(this).data('tipText'));
                $('.about-tooltip').remove();
        }).mousemove(function(e) {
                var mousex = e.pageX + 20; //Get X coordinates
                var mousey = e.pageY + 10; //Get Y coordinates
                $('.about-tooltip')
                .css({ top: mousey, left: mousex })
        });

        if ($('body').hasClass('page-about')) {
          $('.timeline-about-hover').each(function(){
            $(this).after('<div class="timeline-about-desc mobile">' + $(this).attr('title') + '</div>');
          });
        }

        $('.section-blogs a[href^=#]').on('click', function(){
          var link = $(this).attr('href');
          $('html, body').animate({scrollTop:$(link).position().top}, 'slow');
        });

        /**
        * Convert region secondary menu fixed to slide
        */
        if($('body').hasClass('og-context-node-43') && !theme) {
          $('body.og-context-node-43 #block-otcorg-projects-project-navigation  .custom-nav').slick({
            dots: false,
            infinite: false,
            arrows: true,
            slidesToScroll: 8,
            variableWidth: true
          });
        }

        if($('body').hasClass('og-context-node-48') && !theme) {
          $('body.og-context-node-48 #block-otcorg-projects-project-navigation  .custom-nav').slick({
            dots: false,
            infinite: false,
            arrows: true,
            slidesToScroll: 5,
            variableWidth: true
          });
        }

        $(window).resize(checkFeedback);

        if ($feedback.length > 0 && !$feedback.hasClass('feedback-open')) {
          var feedbackHeight = -$feedbackContent.outerHeight();
          $feedback.css('bottom', feedbackHeight);
          $('.region-feedback .block-webform > h2').click(function(){
            if ($feedback.hasClass('feedback-open')) {
              feedbackHeight = -$feedbackContent.outerHeight();
              $feedback.css('bottom', feedbackHeight);
            } else {
              $('.region-feedback').css('bottom', 0);
            }
            $feedback.toggleClass('feedback-open');
          });
        }

      });
    }
  }
})(jQuery, Drupal);
;
